import "./index.css";
const Elements = (props) => {
  const imageSrc = props.imageSrc;
  return (
    <ul id="concepts">
      <li className="concept">
        <img src={props.image} alt={props.title} />
        <h2>{props.title}</h2>
        <p>{props.description}</p>
      </li>
    </ul>
  );
};
export default Elements;
